import React from 'react';

function ProductCard({ product }) {
  return (
    <tr>
      <td>{product.id}</td>
      <td>{product.name}</td>
      <td>{product.email}</td>
      <td><img src={product.image} alt={product.name} width="50" /></td>
      <td>{product.date}</td>
    </tr>
  );
}

export default ProductCard;
